import React from 'react';
import './Home.css';


function Home() {
    return (
        <div className='home-title'>
            <h1>WS工具箱</h1>
            <p>提供各种WS相关的小工具和链接合集，开发中</p>
            <a href="https://github.com/llloydretro2/WSToolBoxReact">github链接</a>
        </div>
    );
}

export default Home;
